DoSlotMachineSpinnyShit:			  ; CODE XREF: BANKF:E89Dj
      JSR     WaitForNMI			  ; $2C-$2E: Reel change timer
						  ; $2F-$31: Current reel icon

      LDA     #SoundEffect2_Climbing		  ; Play "reel sound" sound effect
      STA     SoundEffectQueue2
